import React from "react";
import Header from "../../components/common/Header";
import * as S from "./style";

function LoginPage() {
  return (
    <S.Wrap>
      <Header />
      <S.LoginBlock>
        <S.Title>{"Welcome to I.GPT"}</S.Title>
      </S.LoginBlock>
    </S.Wrap>
  );
}

export default LoginPage;
